while True:
        def phoneinfo(phone):
            try:
                parsed_phone = phonenumbers.parse(phone, None)
                if not phonenumbers.is_valid_number(parsed_phone):
                    return pystyle.Write.Print(f"\n[!]   ->   \n", pystyle.Colors.green, interval=0.005)
                carrier_info = phonenumbers.carrier.name_for_number(parsed_phone, "en")
                country = phonenumbers.geocoder.description_for_number(parsed_phone, "en")
                region = phonenumbers.geocoder.description_for_number(parsed_phone, "ru")
                formatted_number = phonenumbers.format_number(parsed_phone, phonenumbers.PhoneNumberFormat.INTERNATIONAL)
                is_valid = phonenumbers.is_valid_number(parsed_phone)
                is_possible = phonenumbers.is_possible_number(parsed_phone)
                timezona = phonenumbers.timezone.time_zones_for_number(parsed_phone)
                print_phone_info = f"""\n[]   -> {formatted_number}
[]  -> {country}
[]  -> {region}
[]  -> {carrier_info}
[]  -> {is_possible}
[]  -> {is_valid}
[]  -> {timezona}
[] Telegram -> https://t.me/{phone}
[] Whatsapp -> https://wa.me/{phone}
[] Viber -> https://viber.click/{phone}
[] WK ->  https://find.vk.com/{phone}
[] Ok->  https://www.phoneradar.ru/phone/{phone}
[] Facebook-> https://facebook.com/login/identify/{phone}
[] Website-> Nothing found!
[] OpenaIa->https://www.OpenAI.com/{phone}
[] Twiter->https://twitter.com/account/{phone}
[] Avito.1-> https://www.avito.ru/rossiya/{phone}
[] Avito.2-> https://www.avito.com/rossiya/{phone}
[] Rating-> https://www.phoneradar.ru/phone/{phone} 
 [] Skype-> https://Skype.com/{phone}
 [] GetContakt->  https://GettCont.ru/{phone}
 [] Diskord.1-> https://Discord.com/{phone}
 [] Diskord.2-> https://Discord.ru/{phone}
 [] Doxbin-> https://Doxbin.com/{phone}
\n"""
                pystyle.Write.Print(print_phone_info, pystyle.Colors.green, interval=0.005)
            except Exception as e:
                pystyle.Write.Print(f"\n[!]   -> {str(e)}\n", pystyle.Colors.green, interval=0.005)

        phoneinfo(phone)
        
      
